geregisseerd door Darren Grant
met Mary Elizabeth Winstead, Riley Smith en Tessa Thompson

Lauryn is een jonge vrouw uit een klein stadje, die naar Chicago verhuisd met de grote droom om aangenomen te worden aan de Chicago School of Music and Dance. Maar na afwijzing voor haar deelname in de school en een reeks van ongelukken, besluit ze te gaan werken in een club. De club blijkt een plaats te zijn van conflicten en zelf-ontdekking voor Lauryn, en helpt haar te beseffen dat plannen kunnen veranderen, maar dat dromen dat niet doen.

Vanaf 5 februari 2009 in de bioscoop.

